import React from 'react';
import './App.css';
import TodoList from './component/TodoList'

class App extends React.Component {
  constructor() {
    super();
    this.todoItems = [
      // {title: 'Mua bim bim', isComplete: true},
      // {title: 'Di da bong', isComplete: true},
      // {title: 'Di choi', isComplete: false}
    ];
  }
  render() {
    return ( <
      div className = "App" > {
        this.todoItems.length > 0 && this.todoItems.map((item, key) =>
          <
          TodoList key = {
            key
          }
          item = {
            item
          }
          />
        )
      } {
        this.todoItems.length === 0 && < div > 'Nothing here' < /div>
      } <
      /div>
    );
  }
}

export default App;
